    implicit def prisma1Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor]: Prism[Cop3[Id, A1, A2, A3], A2#Cop[Id]] = prisma1F[Id, A1, A2, A3]

    implicit def inja1Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor]: Inj[Cop3[Id, A1, A2, A3], A2#Cop[Id]] = inja1F[Id, A1, A2, A3]

    implicit def inja1IdInverse[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor]: Inj[Option[A2#Cop[Id]], Cop3[Id, A1, A2, A3]] = inja1FInverse[Id, A1, A2, A3]

    implicit def injViaA1Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A](implicit i: Inj[A2#Cop[Id], A]): Inj[Cop3[Id, A1, A2, A3], A] =
