    implicit def injViaA1IdInverse[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A](implicit i: Inj[Option[A], A2#Cop[Id]]): Inj[Option[A], Cop3[Id, A1, A2, A3]] =
