    implicit def prisma2Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor]: Prism[Cop3[Id, A1, A2, A3], A3#Cop[Id]] = prisma2F[Id, A1, A2, A3]

    implicit def inja2Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor]: Inj[Cop3[Id, A1, A2, A3], A3#Cop[Id]] = inja2F[Id, A1, A2, A3]

    implicit def inja2IdInverse[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor]: Inj[Option[A3#Cop[Id]], Cop3[Id, A1, A2, A3]] = inja2FInverse[Id, A1, A2, A3]

    implicit def injViaA2Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A](implicit i: Inj[A3#Cop[Id], A]): Inj[Cop3[Id, A1, A2, A3], A] =
      injViaA2F[Id, A1, A2, A3, A]

    implicit def injViaA2IdInverse[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A](implicit i: Inj[Option[A], A3#Cop[Id]]): Inj[Option[A], Cop3[Id, A1, A2, A3]] =
