  @newtype case class Prod4[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](run: (A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F])) { self =>
    def t1: A1#Prod[F] = run._1
    def t2: A2#Prod[F] = run._2
    def t3: A3#Prod[F] = run._3
    def t4: A4#Prod[F] = run._4

    private def mapN = new Map4P[A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F]] {}

    def map1[B <: AndXor](f: A1#Prod[F] => B#Prod[F]): Prod4[F, B, A2, A3, A4] =
      Prod4[F, B, A2, A3, A4](mapN.map1(run)(f))

    def mapAt[B <: AndXor](f: A1#Prod[F] => B#Prod[F]): Prod4[F, B, A2, A3, A4] =
      Prod4[F, B, A2, A3, A4](mapN.mapAt(f)(run))

    def map2[B <: AndXor](f: A2#Prod[F] => B#Prod[F]): Prod4[F, A1, B, A3, A4] =
      Prod4[F, A1, B, A3, A4](mapN.map2(run)(f))

    def mapAt[B <: AndXor](f: A2#Prod[F] => B#Prod[F])(implicit d: Dummy2): Prod4[F, A1, B, A3, A4] =
      Prod4[F, A1, B, A3, A4](mapN.mapAt(f)(run))

    def map3[B <: AndXor](f: A3#Prod[F] => B#Prod[F]): Prod4[F, A1, A2, B, A4] =
      Prod4[F, A1, A2, B, A4](mapN.map3(run)(f))

    def mapAt[B <: AndXor](f: A3#Prod[F] => B#Prod[F])(implicit d: Dummy3): Prod4[F, A1, A2, B, A4] =
      Prod4[F, A1, A2, B, A4](mapN.mapAt(f)(run))

    def map4[B <: AndXor](f: A4#Prod[F] => B#Prod[F]): Prod4[F, A1, A2, A3, B] =
      Prod4[F, A1, A2, A3, B](mapN.map4(run)(f))

    def mapAt[B <: AndXor](f: A4#Prod[F] => B#Prod[F])(implicit d: Dummy4): Prod4[F, A1, A2, A3, B] =
      Prod4[F, A1, A2, A3, B](mapN.mapAt(f)(run))

  }

  trait Prod4LP {
    implicit def Prod4Transform[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit trans0: Transform[A1#Prod], trans1: Transform[A2#Prod], trans2: Transform[A3#Prod], trans3: Transform[A4#Prod]): Transform[Prod4[?[_], A1, A2, A3, A4]] =
      new Transform[Prod4[?[_], A1, A2, A3, A4]] {
        def transform[F[_], G[_]](nt: F ~> G): Prod4[F, A1, A2, A3, A4] => Prod4[G, A1, A2, A3, A4] =
          p => Prod4[G, A1, A2, A3, A4]((trans0.transform(nt)(p.t1), trans1.transform(nt)(p.t2), trans2.transform(nt)(p.t3), trans3.transform(nt)(p.t4)))
      }

    implicit def Prod4Sequence[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit seq0: Sequence[A1#Prod, Apply], seq1: Sequence[A2#Prod, Apply], seq2: Sequence[A3#Prod, Apply], seq3: Sequence[A4#Prod, Apply]): Sequence[Prod4[?[_], A1, A2, A3, A4], Apply] =
      new Sequence[Prod4[?[_], A1, A2, A3, A4], Apply] {
        def sequence[F[_]](p: Prod4[F, A1, A2, A3, A4])(implicit F: Apply[F]): F[Prod4[Id, A1, A2, A3, A4]] =
          F.ap(seq3.sequence(p.t4))(F.ap(seq2.sequence(p.t3))(F.ap(seq1.sequence(p.t2))(F.map(seq0.sequence[F](p.t1))((i0: A1#Prod[Id]) => (i1: A2#Prod[Id]) => (i2: A3#Prod[Id]) => (i3: A4#Prod[Id]) => Prod4[Id, A1, A2, A3, A4]((i0, i1, i2, i3))))))
      }

    implicit def Prod4FoldMap[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit fm0: FoldMap[A1#Prod, A1#Cop], fm1: FoldMap[A2#Prod, A2#Cop], fm2: FoldMap[A3#Prod, A3#Cop], fm3: FoldMap[A4#Prod, A4#Cop]): FoldMap[Prod4[?[_], A1, A2, A3, A4], Cop4[?[_], A1, A2, A3, A4]] =
      new FoldMap[Prod4[?[_], A1, A2, A3, A4], Cop4[?[_], A1, A2, A3, A4]] {
        def unconsAll[F[_], G[_]](p: Prod4[F, A1, A2, A3, A4])(implicit U: Uncons[F, G]): (List[Cop4[G, A1, A2, A3, A4]], Prod4[F, A1, A2, A3, A4]) = {
          val (h1, t1) = fm0.unconsAll(p.t1)
          val (h2, t2) = fm1.unconsAll(p.t2)
          val (h3, t3) = fm2.unconsAll(p.t3)
          val (h4, t4) = fm3.unconsAll(p.t4)
          (
            List(h1.map(Inj[Cop4[G, A1, A2, A3, A4], A1#Cop[G]].apply(_)), h2.map(Inj[Cop4[G, A1, A2, A3, A4], A2#Cop[G]].apply(_)), h3.map(Inj[Cop4[G, A1, A2, A3, A4], A3#Cop[G]].apply(_)), h4.map(Inj[Cop4[G, A1, A2, A3, A4], A4#Cop[G]].apply(_))).flatten,
            Prod4[F, A1, A2, A3, A4]((t1, t2, t3, t4)))
        }

        def unconsOne[F[_], G[_]](p: Prod4[F, A1, A2, A3, A4], c: Cop4[G, A1, A2, A3, A4])(implicit U: Uncons[F, G]): (Option[Cop4[G, A1, A2, A3, A4]], Prod4[F, A1, A2, A3, A4]) =
          c.run match {
            case -\/(x) =>
              val (h, t) = fm0.unconsOne(p.t1, x)
              (h.map(v => Cop4[G, A1, A2, A3, A4](-\/(v))), Prod4[F, A1, A2, A3, A4]((t, p.t2, p.t3, p.t4)))
            case \/-(-\/(x)) =>
              val (h, t) = fm1.unconsOne(p.t2, x)
              (h.map(v => Cop4[G, A1, A2, A3, A4](\/-(-\/(v)))), Prod4[F, A1, A2, A3, A4]((p.t1, t, p.t3, p.t4)))
            case \/-(\/-(-\/(x))) =>
              val (h, t) = fm2.unconsOne(p.t3, x)
              (h.map(v => Cop4[G, A1, A2, A3, A4](\/-(\/-(-\/(v))))), Prod4[F, A1, A2, A3, A4]((p.t1, p.t2, t, p.t4)))
            case \/-(\/-(\/-(x))) =>
              val (h, t) = fm3.unconsOne(p.t4, x)
              (h.map(v => Cop4[G, A1, A2, A3, A4](\/-(\/-(\/-(v))))), Prod4[F, A1, A2, A3, A4]((p.t1, p.t2, p.t3, t)))

          }
      }

    implicit def Prod4DerivingProd[TC[_], F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit deriving0: DerivingProd[A1#Prod, F, TC], deriving1: DerivingProd[A2#Prod, F, TC], deriving2: DerivingProd[A3#Prod, F, TC], deriving3: DerivingProd[A4#Prod, F, TC]): DerivingProd[Prod4[?[_], A1, A2, A3, A4], F, TC] =
      new DerivingProd[Prod4[?[_], A1, A2, A3, A4], F, TC] {
        def mkContravariant[A](f: A => Prod4[F, A1, A2, A3, A4])(implicit D: Divide[TC]): TC[A] =
          Combine.divide4(deriving0.divide, deriving1.divide, deriving2.divide, deriving3.divide)(f(_).run)

        def mkCovariant[A](f: Prod4[F, A1, A2, A3, A4] => A)(implicit A: Apply[TC]): TC[A] =

          Combine.apply4(deriving0.apply, deriving1.apply, deriving2.apply, deriving3.apply) {
            case (i0, i1, i2, i3) =>
              f(Prod4[F, A1, A2, A3, A4]((i0, i1, i2, i3)))
          }

      }

    implicit def Prod4Monoid[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit M: Monoid[(A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F])]): Monoid[Prod4[F, A1, A2, A3, A4]] =
      MF.xmap(M, Prod4[F, A1, A2, A3, A4](_: (A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F])), (_: Prod4[F, A1, A2, A3, A4]).run)

    implicit def lifta0F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A1#Prod[F]] =
      {
        val t = M.zero
        Inj.instance(x => Prod4[F, A1, A2, A3, A4]((x, t.t2, t.t3, t.t4)))
      }

    implicit def lifta0FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor]: Inj[A1#Prod[F], Prod4[F, A1, A2, A3, A4]] =
      Inj.instance(_.t1)

    implicit def liftViaA0F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A1#Prod[F], A], M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A] =
      Inj.instance((i.apply _).andThen(lifta0F[F, A1, A2, A3, A4].apply _))

    implicit def liftViaA0FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A, A1#Prod[F]]): Inj[A, Prod4[F, A1, A2, A3, A4]] =
      Inj.instance((lifta0FInverse[F, A1, A2, A3, A4].apply _).andThen(i.apply _))

    implicit def lifta1F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A2#Prod[F]] =
      {
        val t = M.zero
        Inj.instance(x => Prod4[F, A1, A2, A3, A4]((t.t1, x, t.t3, t.t4)))
      }

    implicit def lifta1FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor]: Inj[A2#Prod[F], Prod4[F, A1, A2, A3, A4]] =
      Inj.instance(_.t2)

    implicit def liftViaA1F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A2#Prod[F], A], M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A] =
      Inj.instance((i.apply _).andThen(lifta1F[F, A1, A2, A3, A4].apply _))

    implicit def liftViaA1FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A, A2#Prod[F]]): Inj[A, Prod4[F, A1, A2, A3, A4]] =
      Inj.instance((lifta1FInverse[F, A1, A2, A3, A4].apply _).andThen(i.apply _))

    implicit def lifta2F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A3#Prod[F]] =
      {
        val t = M.zero
        Inj.instance(x => Prod4[F, A1, A2, A3, A4]((t.t1, t.t2, x, t.t4)))
      }

    implicit def lifta2FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor]: Inj[A3#Prod[F], Prod4[F, A1, A2, A3, A4]] =
      Inj.instance(_.t3)

    implicit def liftViaA2F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A3#Prod[F], A], M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A] =
      Inj.instance((i.apply _).andThen(lifta2F[F, A1, A2, A3, A4].apply _))

    implicit def liftViaA2FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A, A3#Prod[F]]): Inj[A, Prod4[F, A1, A2, A3, A4]] =
      Inj.instance((lifta2FInverse[F, A1, A2, A3, A4].apply _).andThen(i.apply _))

    implicit def lifta3F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A4#Prod[F]] =
      {
        val t = M.zero
        Inj.instance(x => Prod4[F, A1, A2, A3, A4]((t.t1, t.t2, t.t3, x)))
      }

    implicit def lifta3FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor]: Inj[A4#Prod[F], Prod4[F, A1, A2, A3, A4]] =
      Inj.instance(_.t4)

    implicit def liftViaA3F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A4#Prod[F], A], M: Monoid[Prod4[F, A1, A2, A3, A4]]): Inj[Prod4[F, A1, A2, A3, A4], A] =
      Inj.instance((i.apply _).andThen(lifta3F[F, A1, A2, A3, A4].apply _))

    implicit def liftViaA3FInverse[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A, A4#Prod[F]]): Inj[A, Prod4[F, A1, A2, A3, A4]] =
      Inj.instance((lifta3FInverse[F, A1, A2, A3, A4].apply _).andThen(i.apply _))
  }

  object Prod4 extends Prod4LP {
    implicit def lifta0Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit M: Monoid[Prod4[Id, A1, A2, A3, A4]]): Inj[Prod4[Id, A1, A2, A3, A4], A1#Prod[Id]] =

      lifta0F[Id, A1, A2, A3, A4]

    implicit def lifta0IdInverse[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor]: Inj[A1#Prod[Id], Prod4[Id, A1, A2, A3, A4]] =
      lifta0FInverse[Id, A1, A2, A3, A4]

    implicit def liftViaA0Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A1#Prod[Id], A], M: Monoid[Prod4[Id, A1, A2, A3, A4]]): Inj[Prod4[Id, A1, A2, A3, A4], A] =
      liftViaA0F[Id, A1, A2, A3, A4, A]

    implicit def liftViaA0IdInverse[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A, A1#Prod[Id]]): Inj[A, Prod4[Id, A1, A2, A3, A4]] =
      liftViaA0FInverse[Id, A1, A2, A3, A4, A]

    implicit def lifta1Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor](implicit M: Monoid[Prod4[Id, A1, A2, A3, A4]]): Inj[Prod4[Id, A1, A2, A3, A4], A2#Prod[Id]] =

      lifta1F[Id, A1, A2, A3, A4]

    implicit def lifta1IdInverse[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor]: Inj[A2#Prod[Id], Prod4[Id, A1, A2, A3, A4]] =
      lifta1FInverse[Id, A1, A2, A3, A4]

    implicit def liftViaA1Id[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A](implicit i: Inj[A2#Prod[Id], A], M: Monoid[Prod4[Id, A1, A2, A3, A4]]): Inj[Prod4[Id, A1, A2, A3, A4], A] =
      liftViaA1F[Id, A1, A2, A3, A4, A]

