  @newtype case class Prod5[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A5 <: AndXor](run: (A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F], A5#Prod[F])) { self =>
    def t1: A1#Prod[F] = run._1
    def t2: A2#Prod[F] = run._2
    def t3: A3#Prod[F] = run._3
    def t4: A4#Prod[F] = run._4
    def t5: A5#Prod[F] = run._5

    private def mapN = new Map5P[A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F], A5#Prod[F]] {}

    def map1[B <: AndXor](f: A1#Prod[F] => B#Prod[F]): Prod5[F, B, A2, A3, A4, A5] =
      Prod5[F, B, A2, A3, A4, A5](mapN.map1(run)(f))

    def mapAt[B <: AndXor](f: A1#Prod[F] => B#Prod[F]): Prod5[F, B, A2, A3, A4, A5] =
      Prod5[F, B, A2, A3, A4, A5](mapN.mapAt(f)(run))

    def map2[B <: AndXor](f: A2#Prod[F] => B#Prod[F]): Prod5[F, A1, B, A3, A4, A5] =
      Prod5[F, A1, B, A3, A4, A5](mapN.map2(run)(f))

    def mapAt[B <: AndXor](f: A2#Prod[F] => B#Prod[F])(implicit d: Dummy2): Prod5[F, A1, B, A3, A4, A5] =
      Prod5[F, A1, B, A3, A4, A5](mapN.mapAt(f)(run))

    def map3[B <: AndXor](f: A3#Prod[F] => B#Prod[F]): Prod5[F, A1, A2, B, A4, A5] =
      Prod5[F, A1, A2, B, A4, A5](mapN.map3(run)(f))

    def mapAt[B <: AndXor](f: A3#Prod[F] => B#Prod[F])(implicit d: Dummy3): Prod5[F, A1, A2, B, A4, A5] =
      Prod5[F, A1, A2, B, A4, A5](mapN.mapAt(f)(run))

    def map4[B <: AndXor](f: A4#Prod[F] => B#Prod[F]): Prod5[F, A1, A2, A3, B, A5] =
      Prod5[F, A1, A2, A3, B, A5](mapN.map4(run)(f))

    def mapAt[B <: AndXor](f: A4#Prod[F] => B#Prod[F])(implicit d: Dummy4): Prod5[F, A1, A2, A3, B, A5] =
      Prod5[F, A1, A2, A3, B, A5](mapN.mapAt(f)(run))

    def map5[B <: AndXor](f: A5#Prod[F] => B#Prod[F]): Prod5[F, A1, A2, A3, A4, B] =
      Prod5[F, A1, A2, A3, A4, B](mapN.map5(run)(f))

    def mapAt[B <: AndXor](f: A5#Prod[F] => B#Prod[F])(implicit d: Dummy5): Prod5[F, A1, A2, A3, A4, B] =
      Prod5[F, A1, A2, A3, A4, B](mapN.mapAt(f)(run))

