  trait Prod5LP {
    implicit def Prod5Transform[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A5 <: AndXor](implicit trans0: Transform[A1#Prod], trans1: Transform[A2#Prod], trans2: Transform[A3#Prod], trans3: Transform[A4#Prod], trans4: Transform[A5#Prod]): Transform[Prod5[?[_], A1, A2, A3, A4, A5]] =
      new Transform[Prod5[?[_], A1, A2, A3, A4, A5]] {
        def transform[F[_], G[_]](nt: F ~> G): Prod5[F, A1, A2, A3, A4, A5] => Prod5[G, A1, A2, A3, A4, A5] =
          p => Prod5[G, A1, A2, A3, A4, A5]((trans0.transform(nt)(p.t1), trans1.transform(nt)(p.t2), trans2.transform(nt)(p.t3), trans3.transform(nt)(p.t4), trans4.transform(nt)(p.t5)))
      }

    implicit def Prod5Sequence[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A5 <: AndXor](implicit seq0: Sequence[A1#Prod, Apply], seq1: Sequence[A2#Prod, Apply], seq2: Sequence[A3#Prod, Apply], seq3: Sequence[A4#Prod, Apply], seq4: Sequence[A5#Prod, Apply]): Sequence[Prod5[?[_], A1, A2, A3, A4, A5], Apply] =
      new Sequence[Prod5[?[_], A1, A2, A3, A4, A5], Apply] {
        def sequence[F[_]](p: Prod5[F, A1, A2, A3, A4, A5])(implicit F: Apply[F]): F[Prod5[Id, A1, A2, A3, A4, A5]] =
          F.ap(seq4.sequence(p.t5))(F.ap(seq3.sequence(p.t4))(F.ap(seq2.sequence(p.t3))(F.ap(seq1.sequence(p.t2))(F.map(seq0.sequence[F](p.t1))((i0: A1#Prod[Id]) => (i1: A2#Prod[Id]) => (i2: A3#Prod[Id]) => (i3: A4#Prod[Id]) => (i4: A5#Prod[Id]) => Prod5[Id, A1, A2, A3, A4, A5]((i0, i1, i2, i3, i4)))))))
      }

    implicit def Prod5FoldMap[A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A5 <: AndXor](implicit fm0: FoldMap[A1#Prod, A1#Cop], fm1: FoldMap[A2#Prod, A2#Cop], fm2: FoldMap[A3#Prod, A3#Cop], fm3: FoldMap[A4#Prod, A4#Cop], fm4: FoldMap[A5#Prod, A5#Cop]): FoldMap[Prod5[?[_], A1, A2, A3, A4, A5], Cop5[?[_], A1, A2, A3, A4, A5]] =
      new FoldMap[Prod5[?[_], A1, A2, A3, A4, A5], Cop5[?[_], A1, A2, A3, A4, A5]] {
        def unconsAll[F[_], G[_]](p: Prod5[F, A1, A2, A3, A4, A5])(implicit U: Uncons[F, G]): (List[Cop5[G, A1, A2, A3, A4, A5]], Prod5[F, A1, A2, A3, A4, A5]) = {
          val (h1, t1) = fm0.unconsAll(p.t1)
          val (h2, t2) = fm1.unconsAll(p.t2)
          val (h3, t3) = fm2.unconsAll(p.t3)
          val (h4, t4) = fm3.unconsAll(p.t4)
          val (h5, t5) = fm4.unconsAll(p.t5)
          (
            List(h1.map(Inj[Cop5[G, A1, A2, A3, A4, A5], A1#Cop[G]].apply(_)), h2.map(Inj[Cop5[G, A1, A2, A3, A4, A5], A2#Cop[G]].apply(_)), h3.map(Inj[Cop5[G, A1, A2, A3, A4, A5], A3#Cop[G]].apply(_)), h4.map(Inj[Cop5[G, A1, A2, A3, A4, A5], A4#Cop[G]].apply(_)), h5.map(Inj[Cop5[G, A1, A2, A3, A4, A5], A5#Cop[G]].apply(_))).flatten,
            Prod5[F, A1, A2, A3, A4, A5]((t1, t2, t3, t4, t5)))
        }

        def unconsOne[F[_], G[_]](p: Prod5[F, A1, A2, A3, A4, A5], c: Cop5[G, A1, A2, A3, A4, A5])(implicit U: Uncons[F, G]): (Option[Cop5[G, A1, A2, A3, A4, A5]], Prod5[F, A1, A2, A3, A4, A5]) =
          c.run match {
            case -\/(x) =>
              val (h, t) = fm0.unconsOne(p.t1, x)
              (h.map(v => Cop5[G, A1, A2, A3, A4, A5](-\/(v))), Prod5[F, A1, A2, A3, A4, A5]((t, p.t2, p.t3, p.t4, p.t5)))
            case \/-(-\/(x)) =>
              val (h, t) = fm1.unconsOne(p.t2, x)
              (h.map(v => Cop5[G, A1, A2, A3, A4, A5](\/-(-\/(v)))), Prod5[F, A1, A2, A3, A4, A5]((p.t1, t, p.t3, p.t4, p.t5)))
            case \/-(\/-(-\/(x))) =>
              val (h, t) = fm2.unconsOne(p.t3, x)
              (h.map(v => Cop5[G, A1, A2, A3, A4, A5](\/-(\/-(-\/(v))))), Prod5[F, A1, A2, A3, A4, A5]((p.t1, p.t2, t, p.t4, p.t5)))
            case \/-(\/-(\/-(-\/(x)))) =>
              val (h, t) = fm3.unconsOne(p.t4, x)
              (h.map(v => Cop5[G, A1, A2, A3, A4, A5](\/-(\/-(\/-(-\/(v)))))), Prod5[F, A1, A2, A3, A4, A5]((p.t1, p.t2, p.t3, t, p.t5)))
            case \/-(\/-(\/-(\/-(x)))) =>
              val (h, t) = fm4.unconsOne(p.t5, x)
              (h.map(v => Cop5[G, A1, A2, A3, A4, A5](\/-(\/-(\/-(\/-(v)))))), Prod5[F, A1, A2, A3, A4, A5]((p.t1, p.t2, p.t3, p.t4, t)))

          }
      }

    implicit def Prod5DerivingProd[TC[_], F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A5 <: AndXor](implicit deriving0: DerivingProd[A1#Prod, F, TC], deriving1: DerivingProd[A2#Prod, F, TC], deriving2: DerivingProd[A3#Prod, F, TC], deriving3: DerivingProd[A4#Prod, F, TC], deriving4: DerivingProd[A5#Prod, F, TC]): DerivingProd[Prod5[?[_], A1, A2, A3, A4, A5], F, TC] =
      new DerivingProd[Prod5[?[_], A1, A2, A3, A4, A5], F, TC] {
        def mkContravariant[A](f: A => Prod5[F, A1, A2, A3, A4, A5])(implicit D: Divide[TC]): TC[A] =
          Combine.divide5(deriving0.divide, deriving1.divide, deriving2.divide, deriving3.divide, deriving4.divide)(f(_).run)

        def mkCovariant[A](f: Prod5[F, A1, A2, A3, A4, A5] => A)(implicit A: Apply[TC]): TC[A] =

          Combine.apply5(deriving0.apply, deriving1.apply, deriving2.apply, deriving3.apply, deriving4.apply) {
            case (i0, i1, i2, i3, i4) =>
              f(Prod5[F, A1, A2, A3, A4, A5]((i0, i1, i2, i3, i4)))
          }

      }

