      MF.xmap(M, Prod5[F, A1, A2, A3, A4, A5](_: (A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F], A5#Prod[F])), (_: Prod5[F, A1, A2, A3, A4, A5]).run)

    implicit def lifta0F[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A5 <: AndXor](implicit M: Monoid[Prod5[F, A1, A2, A3, A4, A5]]): Inj[Prod5[F, A1, A2, A3, A4, A5], A1#Prod[F]] =
