  @newtype case class Prod7[F[_], A1 <: AndXor, A2 <: AndXor, A3 <: AndXor, A4 <: AndXor, A5 <: AndXor, A6 <: AndXor, A7 <: AndXor](run: (A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F], A5#Prod[F], A6#Prod[F], A7#Prod[F])) { self =>
    def t1: A1#Prod[F] = run._1
    def t2: A2#Prod[F] = run._2
    def t3: A3#Prod[F] = run._3
    def t4: A4#Prod[F] = run._4
    def t5: A5#Prod[F] = run._5
    def t6: A6#Prod[F] = run._6
    def t7: A7#Prod[F] = run._7

    private def mapN = new Map7P[A1#Prod[F], A2#Prod[F], A3#Prod[F], A4#Prod[F], A5#Prod[F], A6#Prod[F], A7#Prod[F]] {}

    def map1[B <: AndXor](f: A1#Prod[F] => B#Prod[F]): Prod7[F, B, A2, A3, A4, A5, A6, A7] =
      Prod7[F, B, A2, A3, A4, A5, A6, A7](mapN.map1(run)(f))

    def mapAt[B <: AndXor](f: A1#Prod[F] => B#Prod[F]): Prod7[F, B, A2, A3, A4, A5, A6, A7] =
      Prod7[F, B, A2, A3, A4, A5, A6, A7](mapN.mapAt(f)(run))

