          c => Cop7[G, A1, A2, A3, A4, A5, A6, A7](c.run.bimap(_.transform(nt), _.bimap(_.transform(nt), _.bimap(_.transform(nt), _.bimap(_.transform(nt), _.bimap(_.transform(nt), _.bimap(_.transform(nt), _.transform(nt))))))))
